import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return (
        <>
            <nav>
                <ul>
                    <li>
                        <Link to="/DailyLeaderBoard">Daily Leaderboard</Link>
                    </li>
                    <li>
                        <Link to="/WeeklyLeaderboard">Weekly Leaderboard</Link>
                    </li>
                    <li>
                        <Link to="/Play">Play Today's Sudokle</Link>
                    </li>

                </ul>
            </nav>

            <Outlet />
        </>
    )
};

export default Layout;
